import * as React from 'react';
import { Card, CardMedia, CardContent, CardActionArea, CardHeader, Typography, Divider, ThemeProvider } from '@material-ui/core';
import { projectData } from '../data/data';

const Projects = (props) => {
  const handleCardClick = (url) => {
    window.open(url, "_blank");
  }

  return (
    <div className='projects' >
      <Divider variant="middle" />
      <Typography variant='h3'>Recent Projects</Typography>
      <div className='projects-container'>
        {projectData.map((data, key) => {
          return (
            <Card className='project-card' onClick={() => handleCardClick(data.link)} key={key}>
              <CardActionArea>
                <CardHeader title={data.name} />
                <CardMedia component="img" image={data.image} alt='project' />
                <CardContent>
                  <Typography variant='body1' component='p'>{data.description}</Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          );
        })}
      </div>
    </div>
  );
}
export default Projects;
